import React, { useState, useEffect } from "react";
import axios from "axios";

const Api = (props) => {
  useEffect(() => {
    axios.get("/api/hello").then((res) => setState(res.data));
  }, []);

  const [state, setState] = useState("");
  console.log(state);

  return (
    <div>
      <p>Information from database:</p>
      <p>{console.log(state)}</p>
    </div>
  );
};

export default Api;
